import React from 'react'
// import { Link } from 'react-router-dom';
import * as rb from "react-bootstrap";

const colStyle = {
    margin: "3em",
    diplay: "flex",
}

class Sem4 extends React.Component {
    render() {
        return (
            <rb.Container >
                <rb.Row>
                    <rb.Col style={colStyle}>
                        {/* <Link to={`/cse/1`}> */}
                        <rb.Button variant="outline-primary">
                            Database Management System [DBMS]
                        </rb.Button>
                        {/* </Link> */}

                    </rb.Col >
                    <rb.Col style={colStyle}>
                        JAVA
                    </rb.Col>
                    <rb.Col style={colStyle}>
                        Data Structure  And Algorithms [DAA]
                    </rb.Col>
                </rb.Row>
                <rb.Row>
                    <rb.Col style={colStyle}>
                        Operating System [OS]
                    </rb.Col>
                    <rb.Col style={colStyle}>
                        ENGINEERING MATHEMATICS-IV [MATH4]
                    </rb.Col>
                </rb.Row>
            </rb.Container>
        );
    }
}

export default Sem4;
